import actionTypes from './actionTypes';
import { getAllCodeServiece } from "../../services/userService";

// export const fetchGenderStart = () => ({
//     type: actionTypes.FETCH_GENDER_START
// })

export const fetchGenderStart = () => {
    return async (dispatch, getState)  =>  {
    try{
        dispatch({ type: actionTypes,FETCH_GENDER_START })
        let res = await getAllCodeServiece("GENDER");
        if ( res && res.errCode === 0){
            console.log('check get state: ', getState)
            dispatch(fetchGenderSucces(res.data));
        }
        else{
            dispatch(fetchGenderfailed());
        }
    }catch(e){
        fetchGenderfailed();
        console.log('fetchGenderStart error', e)
        }
    }
}
    
    


export const fetchGenderSucces = (genderData) => ({
    type: actionTypes.FETCH_GENDER_SUCCESS,
    data: genderData
})

export const fetchGenderfailed = () => ({
    type: actionTypes.FETCH_GENDER_FAILED
})
